import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'
import helloWorld from './components/HelloWorld.vue'

Vue.config.productionTipo = false
Vue.use(VueRouter)

const routes = [
    {path: '/home',component: helloWorld}
]

const router = new VueRouter({
    routes,
    mode: 'history'
})

new Vue({
    router,
    render: h => h(App)
}).$mount('#app')
